import {SignupChild} from "../childcomponents/SignupChild";

export const SignupComponent = () => {
    const signup = (firstname,lastname,email,password,birthdate,phone_number,joined_date, role_type_id) => {
        console.log(firstname,lastname,email,password,birthdate,phone_number,joined_date, role_type_id)
    }
    const signupParameters={
        firstname:{
            label:"Prénom",
            placeholder:"Entrez votre prénom",
            type:"text",
        },
        lastname:{
            label:"Nom",
            placeholder:"Entrez votre nom",
            type:"text",
        },
        email:{
            label:"Adresse email",
            placeholder:"Entrez votre adresse email",
            type:"email",
        },
        password: {
            label: "Mot de passe",
            placeholder: "Entrez votre mot de passe",
            type: "password",
        },
        birthdate:{
            label:"Date de naissance",
            type:"date",
        },
        phone_number:{
            label:"Numéro de téléphone",
            placeholder:"Entrez votre numéro de téléphone",
            type:"tel",
            pattern:"[0-9]{3}-[0-9]{2}-[0-9]{3}-[0-9]{2}",
        },
        button:{
            value:"S'inscrire"
        },
        title:"Inscription",
        subtitle:"Créez votre compte",
        signinUrl:"/signin",
        event: signup
    }

    return (
        <SignupChild signupParameters={signupParameters}/>
    )
}
